/***/ "(rsc)/./src/lib/GlobalCarousel/data.json":
/*!******************************************!*\
  !*** ./src/lib/GlobalCarousel/data.json ***!
  \******************************************/
/***/ ((module) => {

"use strict";
module.exports = JSON.parse('[{"img":"/Carousel/Global/1.webp","content":"\\"The trip lived up to luxury standards. The hotel is very cozy and comfortable boutique hotel. Everything is high quality and very well designed. Staff is so friendly and welcoming. The VIP transfers were convenient, and the Cappadocia tour was perfect to see the history. Also Dont miss watching the balloons in early morning which is fascinating!\\"","footer":"Mark  October 2023"},{"img":"/Carousel/Global/2.webp","content":"\\"If youre looking for a trip to Cappadocia, this is it. It exceeded our expectations. The hosts are so genuinely nice. The breakfast is amazing. Mak and the staff are so hospitable. The rooms are beautifully decorated, the rooms are spacious, along with the bathroom. Our day touring Cappadocia with them was beautiful. The Turkish Night was also a very fun experience. This tour has everything you need.\\"","footer":"Rania  October 2023"},{"img":"/Carousel/Global/3.webp","content":"\\"Hotel provided luxury accommodations, and the VIP transfers were smooth. The guided tours helped us to explore the city\'s cultural and historical depth. Mehmet, our guide in the Old City Walking Tour really tried- I want to give a special shout out to him. Makbule\'s team was also always just a call away, making sure everything was perfect. They were the best! I am so glad I saw their offer.\\"","footer":"Richard  November 2023"},{"img":"/Carousel/Global/4.webp","content":"\\"The hotel was outstanding and way beyond expectations. Varied breakfast, location close to Blue Mosque and Hagia Sophia (5-10min walk). Not cheap but perfect restaurant. Very helpful and friendly staff. People were also always in contact with us to make sure our trip was going well. The tours were simply incredible, and I really enjoyed all of Istanbul. From the moment we touched down, this trip was exceptional.\\"","footer":"Emma  November 2023"},{"img":"/Carousel/Global/5.webp","content":"\\"Looking back, I am shocked at how great our trip was. Especially at this price point. The tours were beautiful, and our hotel was amazing. Very close to all the best attractions. But the best part was Makbule who was always available to help, regardless of what time it was. Also our tour guides would never fail to make us laugh and helped with everything. Cant recommend this tour enough!\\"","footer":"Michelle  October 2023"},{"img":"/Carousel/Global/6.webp","content":"\\"Outside of the beauty of Istanbul, we were treated to great hospitality. The welcome appetizers and the constant smiles all show how much these people care about their country. I want to give a thanks to Mrs. Makbule for recommending the best spots to get dinner on our last day. We went to Sanric Restaurant (In Sultan Ahemed) and it was a special time for me and my wife.\\"","footer":"Omari  September 2023"},{"img":"/Carousel/Global/7.webp","content":"\\"From the moment I arrived, the driver greeted us with warmth and professionalism. The attention to detail throughout the tour was impressive, Our hotel was immaculate and well-appointed. However, the staff by far were the best part. Never said no to anything, and was always happy to help. In the hotel, the tours, and the phone contact. Thank you for such an amazing experience!\\"","footer":"Chloe  August 2023"},{"img":"/Carousel/Global/8.webp","content":"\\"From the moment we arrived in Istanbul, it was clear that this tour was going to be good. The little stuff really showed driver was waiting with our name and offered us water right after we got on the vito. The hotel was good, and the staff so kind.Bosphorus Cruise was absolutely breathtaking. Kudos to Mrs. Makbule for curating such a fantastic experience!\\"","footer":"Sophie  August 2023"},{"img":"/Carousel/Global/9.webp","content":"\\"I want to give a special shoutout to the owner Mak and her staff are polite, very friendly and accommodating. They were the reason why our trip was so wonderful! The boy who works at night doesnt speak English, but he will try his best to help you. He offered us tea/ coffee while we were watching balloons on the roof top in the early morning and made sure we got to our tours on time. Lovely Experience!\\"","footer":"Patrick  October 2023"}]');

/***/ }),

