module.exports = JSON.parse('[{"content":"From the moment we stepped off the plane to the final farewell, this trip was premium. Our transportation was perfectly arranged with no delays, and Makbule was in constant contact with me to make sure everything was ok. The hotel is in a good location, walking distance to major attractions in the old town, Blue Mosque, Hagia Sofia, etc.. Our room was spacious and comfortable, with a lovely terrace looking into the inner courtyard. Breakfast was also fabulous. Our tours were amazing, and our guides Mehmet and Ali were always cheerful. Thank you for the amazing time!","footer":"John  November 2023"},{"content":"Our package was filled with memories that will last a lifetime. I was dreaming of a trip to Istanbul for a long time. Everyone in the family really enjoyed the Bosphorus Cruise Tour and it was definitely the highlight for us. The location of our hotel was very good has an amazing restaurant including great breakfast. Also the service is very fast and staff is really helpful. The overall vibe is great and is 5 mins from blue mosque. I dont have any complaints for the entire tour, highly recommend Fadas to anyone that wants to see Turkey!","footer":"Aisha  November 2023"},{"content":"Hotel provided luxury accommodations, and the VIP transfers were smooth. The guided tours helped us to explore the city\'s cultural and historical depth. Mehmet, our guide in the Old City Walking Tour really tried- I want to give a special shout out to him. Makbule\'s team was also always just a call away, making sure everything was perfect. They were the best! I am so glad I saw their offer.","footer":"Richard  November 2023"},{"content":"The hotel was outstanding and way beyond expectations. Varied breakfast, location close to Blue Mosque and Hagia Sophia (5-10min walk). Not cheap but perfect restaurant. Very helpful and friendly staff. People were also always in contact with us to make sure our trip was going well. The tours were simply incredible, and I really enjoyed all of Istanbul. From the moment we touched down, this trip was exceptional.","footer":"Emma  November 2023"},{"content":"Although I didnt get to meet her in person, Makbule made sure we were everything was arranged on time and it was literally like clock work. My husband and I never worried about anything - out entire trip was planned out. The hotel was also a true gem, and everyone was always so kind and made sure we were satisfied. It was cozy and clean and the staff was really welcoming. On our arrival in the early morning we were received by Omer, who was always nice and smiling. Our tour guide Mehmet was also so hilarious and we are going to miss him! Thank you for this amazing experience!","footer":"Maria  October 2023"},{"content":"First trip to Istanbul our tour guide opened our eyes to this city. Accommodations, transport & meals supplied were excellent.","footer":"Thomas  October 2023"},{"content":"Our journey was a premium experience from the start. The hotel was premium as stated, and Makbule made sure our time was perfect. We\'re very grateful for her. The tours were incredibly enjoyable and comfortable. I will definitely travel to Turkey with them again.","footer":"Fatima  October 2023"},{"content":"Looking back, I am shocked at how great our trip was. Especially at this price point. The tours were beautiful, and our hotel was amazing. Very close to all the best attractions. But the best part was Makbule who was always available to help, regardless of what time it was. Also our tour guides would never fail to make us laugh and helped with everything. Cant recommend this tour enough!","footer":"Michelle  October 2023"},{"content":"Our journey was amazing since we arrived. The hotel was comfortable, and Makbule\'s team was always check everything went good. We\'re happy to have chosen Fadas for Istanbul package!","footer":"Ekaterina  October 2023"},{"content":"Istanbul was exceptional from start to finish. Transfers and hotel was high quality. The tours were great, and our guides too. No problems.","footer":"Kumar  October 2023"},{"content":"The hotel truly was premium standards. The VIP transfers were convenient, and the tours were a blend of history and culture. I highly encourage everyone to take this trip! It was our first time in Turkey, and definitely won\'t be our last!","footer":"Larry  October 2023"},{"content":"Outside of the beauty of Istanbul, we were treated to great hospitality. The welcome appetizers and the constant smiles all show how much these people care about their country. I want to give a thanks to Mrs. Makbule for recommending the best spots to get dinner on our last day. We went to Sanric Restaurant (In Sultan Ahemed) and it was a special time for me and my wife. Fadas is an amazing choice when traveling to Istanbul!","footer":"Omari  September 2023"},{"content":"Very surprised by the quality at this price. This was a premium trip. From the VIP airport transfer to the final breakfast, every moment was planned to detail. The guided tours provided an understanding of the city\'s history, and the tour guides were very knowledgeable.","footer":"Jacob  September 2023"},{"content":"We decided to do this after our trip to Umrah before returning back home and so glad we did. Our Istanbul experience package was amazing. I thank every person in the hotel, tour guides, and drivers. They were very kind, helping, and respectful to our family. I am glad we chose Fadas Travel and Ms. Makbule.","footer":"Khadija  September 2023"},{"content":"Everything was amazingly designed by Mrs. Makbule and her team. The best part for me was the guided tours of Sultan Ahmet, Topkapi Palace, and Hagia Sophia. They were more than educational; they were history in front of my eyes. The hotel also had a fantastic location right in the middle of town, just 5 mins to the major attractions. For us (2 adults and 3 children) this tour was also very comfortable. I didnt worry about the transportation and logistics like I usually do on our family trips. I thank everyone who helped me on this tour, and hope to travel to Istanbul again!","footer":"Charlotte  August 2023"},{"content":"This trip to Istanbul surpassed our expectations. For their price point, I wasn\'t expecting it to be this good. The VIP transfers, the guided tours, and the luxurious the hotel made every moment special. Highly recommend it to anyone - very high quality.","footer":"Henry  August 2023"},{"content":"From the moment I arrived, the driver greeted us with warmth and professionalism. The attention to detail throughout the tour was impressive, Our hotel was immaculate and well-appointed. However, the staff by far were the best part. Never said no to anything, and was always happy to help. In the hotel, the tours, and the phone contact. Thank you for such an amazing experience!","footer":"Chloe  August 2023"},{"content":"The hotel was exquisite, and the team at Fadas Travel made sure everything ran smoothly. The guided tours were not only informative but also a lot of fun. I couldn\'t have asked for a better trip.","footer":"Tom  August 2023"},{"content":"From the moment we arrived in Istanbul, it was clear that this tour was going to be good. The little stuff really showed driver was waiting with our name and offered us water right after we got on the vito. The hotel was good, and the staff so kind. Bosphorus Cruise was absolutely breathtaking. Kudos to Mrs. Makbule for curating such a fantastic experience!","footer":"Sophie  August 2023"},{"content":"Istanbul was my list for long time, and this tour pass my expectations. The hotel was amazing. Great location. Friendly staff who professional and prepared. In our tours the guides were very knowledgeable. Also the vip transportation airports made everything very easy.","footer":"Markos  July 2023"},{"content":"The room and facilities in our hotel were good. The breakfast was exceptional. The wifi was good and the staff were very helpful. The food in the hotel restaurant is delicious. Our stay was located very close to all the historical places such as Blue Mosque. Our guide Sercan was also wonderful. He was very personable and we were so glad to be with him!! The convenience of this trip was amazing, and I highly recommend it to anyone coming to Istanbul.","footer":"Emily  July 2023"},{"content":"This tour was the perfect way to explore Istanbul. The hotel was a gem, and the staff\'s hospitality was heartwarming. Our guide Mehmet was not only knowledgeable but also very funny. We miss him already!","footer":"Sarah  July 2023"},{"content":"Istanbul was incredible. The guided tours were very good and our guide very funny. Our hotel had amazing service and staff! We\'re grateful to Mrs. Makbule and her team for journey. I would give it 10 stars if I could! We are already planning a trip with them for Cappadocia.","footer":"Antonio  June 2023"},{"content":"The hotel was awesome, and the guides were passionate and knowledgeable. Istanbul\'s beauty left me speechless, and this tour added so much value to our trip. Fadas Travel knows what they are doing.","footer":"Rachel  June 2023"},{"content":"As a frequent traveler, I can confidently say that this Istanbul trip was class. The hotel was beautiful, and the Bosphorus Tour was something special. Our kids loved it. We also did the Private Yacht Dinner and that was simply amazing. The VIP experience we received was exactly what we were looking for. I cant recommend Istanbul enough.","footer":"Ahmed  June 2023"},{"content":"Our journey was nothing short of extraordinary. The Bosphorus Cruise was a breathtaking experience. Mrs. Makbule and her team truly know how to make a trip special.","footer":"Maria  May 2023"},{"content":"The hotel was good, and the guided tours were funny and educational. Istanbul\'s beauty stands out. But the traffic made it difficult and took away from the experience.","footer":"Salma  May 2023"},{"content":"This tour does everything listed. I was satisfied.","footer":"Santiago  August 2023"},{"content":"Everything went well. Our hotel was good quality, and our tours were exactly like how it was said. However our Istanbul experience wasn\'t the best because it rained a lot.","footer":"Katerina  November 2023"}]');

